import React,{useState} from "react";
import './Header.css';
import Jaipur from "./Jaipur";
import { useHistory } from 'react-router-dom';

const Header = () => {
    const [title, setTitle] = useState('');
    const history = useHistory();
    const handleClick = () => history.push('/goodbye');
    return (
        <div>
            <div className="container">
                <input type="text" placeholder="search images" onMouseOut="{e => setTitle(e.target.value)}"
                className="searchbar"></input>
                <div className="button-images">
                    <button type="button" onClick={handleClick}>Jaipur</button>
                    <button type="button">Mumbai</button>
                    <button type="button">Goa</button>
                </div>
            </div>
            <Jaipur/>
            {console.log(title)}
        </div>
    );
};

export default Header;
